import React from 'react';

function Gallery({currentCategory}) {
  const { name, description } = currentCategory;
  return (
    <section>
      <h1>{currentCategory.name}</h1>
      <p>{currentCategory.description}</p>
    </section>
  );
}
export default Gallery;
